import React from "react";
import styles from "../css/Login.module.css";

const Login = ({ onLoginSuccess }) => {
  const handleLogin = () => {
    // 로그인 검증 로직(예시)
    // 예를 들어, API 호출 결과를 바탕으로 성공 여부를 판단
    const loginSuccessful = true; // 여기서 실제 로그인 성공 여부를 설정
    if (loginSuccessful) {
      onLoginSuccess(); // 로그인 성공시 onLoginSuccess 호출
    }
  };
  return (
    <div className={styles.LoginWrap}>
      <h3 className={styles.LoginLogo}>
        <img src="" alt="" />
      </h3>
      <p>
        안녕하세요.
        <br />
        리치커머스입니다.
      </p>
      <span>서비스 이용을 위해 로그인을 해주세요.</span>

      <form
        action="/login"
        className={styles.LoginFormWrap}
        onClick={handleLogin}
      >
        <div className={styles.LoginEmailWrap}>
          <input
            type="email"
            placeholder="ID"
            id="loginEmail"
            className={styles.LoginEmail}
          />
        </div>

        <div className={styles.LoginPasswordWrap}>
          <input
            type="password"
            placeholder="PASSWORD"
            id="LoginPassword"
            className={styles.LoginPassword}
          />
        </div>

        <button className={styles.LoginSubmitButton}>로그인하기</button>
      </form>
    </div>
  );
};

export default Login;
